import{_ as e,o as t,c as a,a as l}from"./app.b1e5a3e6.js";const m=JSON.parse(`{"title":"v1.0.0","description":"","frontmatter":{},"headers":[{"level":2,"title":"变更摘要：","slug":"变更摘要","link":"#变更摘要","children":[]},{"level":2,"title":"详细变更说明：","slug":"详细变更说明","link":"#详细变更说明","children":[]},{"level":2,"title":"Introduction in English","slug":"introduction-in-english","link":"#introduction-in-english","children":[]},{"level":2,"title":"What's Changed","slug":"what-s-changed","link":"#what-s-changed","children":[]},{"level":2,"title":"New Contributors","slug":"new-contributors","link":"#new-contributors","children":[]}],"relativePath":"about/changelog.md","lastUpdated":1683652040000}`),o={name:"about/changelog.md"},n=l('<h1 id="v1-0-0" tabindex="-1">v1.0.0 <a class="header-anchor" href="#v1-0-0" aria-hidden="true">#</a></h1><blockquote><p>2023/04/19</p></blockquote><h1 id="talextouch" tabindex="-1">TalexTouch <a class="header-anchor" href="#talextouch" aria-hidden="true">#</a></h1><p>我们非常高兴地宣布，我们的产品已经更新到最新版本！在这个版本中，我们加入了一些新特性，修复了一些bug，同时也增加了一些新模块和功能。</p><p>首先，我们引入了一个插件商店。在这个商店中，您可以方便地搜索、下载、安装和管理各种插件，以实现不同的功能和增强用户体验。我们还修复了一些在之前版本中出现的bug，使得插件的加载和卸载更加稳定和可靠。</p><p>另外，我们的导航栏增加了一些新的图标，以帮助您更快地找到并使用您需要的插件。同时，我们还在界面中加入了一些新的链接和后缀，以使得整个产品更加美观和舒适。</p><p>除此之外，我们的升级和安装模块也得到了改进。我们增加了一些新的升级信息，以让您更好地了解最新版本的特性和优化。同时，我们还修复了一些之前版本中出现的问题，使得安装和升级的流程更加顺畅和快速。</p><p>最后，我们想强调的是，我们的产品仍处于快速迭代期，我们将不断努力提高我们的产品质量和性能，增加更多的新特性和功能，使得用户的使用体验更加愉悦和便捷。同时，我们也欢迎广大开发者和用户们积极参与我们的产品开发和测试，提出您的宝贵意见和建议，一同打造更好的产品！</p><p>请您放心使用我们的产品，并期待我们即将发布的2.0.0版本，其中将包含更多强大的功能和更加美观的界面设计，带来更加出色的动效特效。我们预计在接下来的三个月内发布该版本，敬请期待！</p><h2 id="变更摘要" tabindex="-1">变更摘要： <a class="header-anchor" href="#变更摘要" aria-hidden="true">#</a></h2><ul><li>增加插件商店功能，包括插件安装、升级等模块（Pull Request #16）</li><li>增加 App 升级信息提醒模块（Pull Request #16）</li><li>修复插件安装模块的 bug（Pull Request #14）</li><li>增加插件解析模块（Pull Request #14）</li><li>增加 touch-plugin 的链接后缀（Pull Request #15）</li><li>实现导航栏图标显示插件功能，并增加网站新特性介绍（Pull Request #13）</li><li>更新 Layout 模块，修复一些 bug（2023年4月9日提交）</li><li>增加账户功能并修复相关 bug（2023年4月2日提交）</li><li>完全更改插件实现方式，包括提示框等功能（2023年3月12日提交）</li><li>修复两次提示框的 bug 并增加预览功能（2023年2月25日提交）</li><li>增加 App 设置统计部分并修复一些 bug（2023年2月21日提交）</li></ul><h2 id="详细变更说明" tabindex="-1">详细变更说明： <a class="header-anchor" href="#详细变更说明" aria-hidden="true">#</a></h2><p>在 Pull Request #16 中，@TalexDreamSoul 增加了插件商店功能，并添加了插件安装、升级等模块，以及 App 升级信息提醒模块。</p><p>在 Pull Request #14 中，@TalexDreamSoul 增加了插件解析模块，并修复了插件安装模块的 bug。</p><p>在 Pull Request #15 中，@TalexDreamSoul 增加了 touch-plugin 的链接后缀功能。</p><p>在 Pull Request #13 中，@TalexDreamSoul 实现了导航栏图标显示插件功能，并增加了网站新特性介绍。</p><p>此外，@TalexDreamSoul 在之前的提交中还修复了一些 bug，包括更新 Layout 模块、增加账户功能并修复相关 bug、完全更改插件实现方式等。其中在 2023年3月12日提交中，完全更改了插件实现方式，包括提示框等功能。</p><p>在 2023年2月25日提交中，@TalexDreamSoul 修复了两次提示框的 bug 并增加预览功能。</p><p>最后，在 2023年2月21日提交中，@TalexDreamSoul 增加了 App 设置统计部分并修复一些 bug。</p><h2 id="introduction-in-english" tabindex="-1">Introduction in English <a class="header-anchor" href="#introduction-in-english" aria-hidden="true">#</a></h2><p>We are excited to announce that our product has been updated to the latest version! In this version, we have added new features, fixed some bugs, and introduced new modules and functions.</p><p>Firstly, we have introduced a plugin store where you can conveniently search, download, install, and manage various plugins to achieve different functions and enhance user experience. We have also fixed some bugs that occurred in previous versions to make plugin loading and unloading more stable and reliable.</p><p>In addition, we have added some new icons to our navigation bar to help you quickly find and use the plugins you need. We have also added some new links and suffixes to the interface to make the entire product more beautiful and comfortable.</p><p>Furthermore, our upgrade and installation modules have been improved. We have added some new upgrade information to better inform you about the latest features and optimizations in the newest version. At the same time, we have also fixed some issues that occurred in previous versions to make the installation and upgrade process smoother and faster.</p><p>Lastly, we would like to emphasize that our product is still in a fast iteration period, and we will continue to work hard to improve the quality and performance of our product, add more new features and functions, and make the user experience more pleasant and convenient. We also welcome developers and users to actively participate in our product development and testing, and provide your valuable opinions and suggestions to create a better product together!</p><p>Please feel free to use our product and look forward to our upcoming 2.0.0 version, which will contain more powerful features and more beautiful interface designs with fantastic animations. We expect to release this version in the next three months, so stay tuned!</p><h2 id="what-s-changed" tabindex="-1">What&#39;s Changed <a class="header-anchor" href="#what-s-changed" aria-hidden="true">#</a></h2><ul><li>Change&lt;Many&gt;: New features about navbar(icons for plugins) and new we… by @TalexDreamSoul in <a href="https://github.com/talex-touch/talex-touch/pull/13" target="_blank" rel="noreferrer">https://github.com/talex-touch/talex-touch/pull/13</a></li><li>Module&lt;Plugin&gt;: Add plugin resolver modules by @TalexDreamSoul in <a href="https://github.com/talex-touch/talex-touch/pull/14" target="_blank" rel="noreferrer">https://github.com/talex-touch/talex-touch/pull/14</a></li><li>Add&lt;Link&gt;: Link suffix of touch-plugin by @TalexDreamSoul in <a href="https://github.com/talex-touch/talex-touch/pull/15" target="_blank" rel="noreferrer">https://github.com/talex-touch/talex-touch/pull/15</a></li><li>Plugin store by @TalexDreamSoul in <a href="https://github.com/talex-touch/talex-touch/pull/16" target="_blank" rel="noreferrer">https://github.com/talex-touch/talex-touch/pull/16</a></li></ul><h2 id="new-contributors" tabindex="-1">New Contributors <a class="header-anchor" href="#new-contributors" aria-hidden="true">#</a></h2><ul><li>@TalexDreamSoul made their first contribution in <a href="https://github.com/talex-touch/talex-touch/pull/13" target="_blank" rel="noreferrer">https://github.com/talex-touch/talex-touch/pull/13</a></li></ul><p><strong>Full Changelog</strong>: <a href="https://github.com/talex-touch/talex-touch/compare/SNAPSHOT...STARTED" target="_blank" rel="noreferrer">https://github.com/talex-touch/talex-touch/compare/SNAPSHOT...STARTED</a></p>',31),i=[n];function r(u,s,h,d,c,p){return t(),a("div",null,i)}const b=e(o,[["render",r]]);export{m as __pageData,b as default};
